    false,nt"url": null,nt"notes": "This narrative report for Moosehorn NWR
    outlines Refuge accomplishments from May through July of 1941. The report begins
    by summarizing the weather conditions during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, and furbearers- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    and wildfires. The public relations section of the report describes recreational
